import React from 'react';
import PropTypes from 'prop-types';

function Topbar(props) {
  return(
    <div className='ui-topbar' >
        <div className="ui-topbar__left">L</div>
        <div className="ui-topbar__center">C</div>
        <div className="ui-topbar__right">R</div>
    </div>
  );
}

Topbar.propTypes = {};

export default Topbar;
